webpackJsonp([91232480987675],{416:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Mike Herchel",author:"Mike Herchel"}},markdownRemark:{id:"/Users/mherchel/sites/herchel.com/src/blog/2018-07-05-frontend-united/index.md absPath of file >>> MarkdownRemark",html:'<p>Last month, I had the opportunity to go to Utrecht, in the Netherlands for <a href="https://www.frontendunited.org">Frontend United</a>. Frontend United was an amazingly well run conference, and had some amazing content from speakers like <a href="https://www.frontendunited.org/sessions/facsst-css-and-performance">Harry Roberts</a>, <a href="https://www.frontendunited.org/sessions/exploring-new-drupal-front-end-javascript">Dries Buytaert</a>, and <a href="https://www.frontendunited.org/sessions/get-your-priorities-straight">Heydon Pickering</a>.</p>\n<p>I presented on <a href="https://www.frontendunited.org/sessions/debugging-profiling-rocking-out-browser-based-developer-tools">Debugging, Profiling, &#x26; Rocking Out with Browser-Based Developer Tools</a>, which is a tried and true session that I’ve given tens of times. It went over pretty well. </p>\n<p>Enjoy!</p>\n<p><div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 50%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <div><iframe src="https://www.youtube.com/embed/pnVZs-Tapq8" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe></div>\n          </div>\n          </div></p>',excerpt:"Last month, I had the opportunity to go to Utrecht, in the Netherlands for  Frontend United . Frontend United was an amazingly well run…",frontmatter:{title:"My Presentation at Frontend United in the Netherlands",date:"July 05, 2018",author:null}}},pathContext:{slug:"/2018-07-05-frontend-united/"}}}});
